CREATE SCHEMA supermario;
use supermario;
drop table if exists courses;
-- creating a table COURSES -- 

CREATE TABLE courses 
( map_id VARCHAR(255),
  difficulty VARCHAR(255),
  gameStyle VARCHAR(255),
  maker VARCHAR(255),
  title VARCHAR(255),
  thumbnail VARCHAR(255),
  image VARCHAR(255),
  creation VARCHAR(255),PRIMARY KEY(map_id));



-- creating a table PLAYERS -- 
drop table if exists players;
CREATE TABLE players 
( player_id VARCHAR(255),
  image VARCHAR(255),
  flag VARCHAR(255),
  player_name VARCHAR(255),PRIMARY KEY(player_id));
truncate players;
use supermario;
select * from players;
-- create table CLEARS --
drop table clears;
CREATE TABLE clears(
  catch VARCHAR(255),
  game_id VARCHAR(255),
  player_id VARCHAR(255));

select * from clears;
-- create table COURSE META --
drop table course_meta;
CREATE TABLE course_meta (
  catch timestamp,
  map_id VARCHAR(255),
  firstClear VARCHAR(255),
  tag VARCHAR(255),
  stars INT,
  no_of_players INT,
  tweets INT,
  clears INT,
  attempts INT,
  clearRate FLOAT);

select * from course_meta;
-- creating table likes --
drop table likes;
CREATE TABLE likes (
  catch timestamp,
  game_id VARCHAR(255),
  player_id VARCHAR(255)
);
  select * from likes;
-- creating table plays -- 
drop table plays;
CREATE TABLE plays(
  catch timestamp,
  game_id VARCHAR(255),
  player_id VARCHAR(255)
);

select * from plays;

-- create last table called records --
drop table records if exists;
CREATE TABLE records (
  catch timestamp,
  game_id VARCHAR(255),
  player_id VARCHAR(255),
  timeRecord_milliseconds INT
);
